import { StyleSheet } from "react-native";

import { gameCardLogoBorderColor, gameTitleTextColor } from "../../styles";

export const titleFontSize = 12;

const styles = StyleSheet.create({
  card: {
    width: 120,
    backgroundColor: "transparent",
  },
  logo: {
    width: 120,
    height: 120,
    borderWidth: 0.5,
    borderColor: gameCardLogoBorderColor,
    borderRadius: 1,
    marginBottom: 8,
  },
  title: {
    fontFamily: "Agrandir-Regular",
    fontStyle: "normal",
    fontWeight: "400",
    fontSize: titleFontSize,
    lineHeight: 1.34 * titleFontSize,
    letterSpacing: 0.06 * titleFontSize,
    color: gameTitleTextColor,
  },
});

export default styles;
